import React from 'react';
import Container from 'react-bootstrap/Container';
import Nav from 'react-bootstrap/Nav';
import Navbar from 'react-bootstrap/Navbar';
import img2 from '../src/img/IMG-20250327-WA0003.jpg';


class MyNavbar extends React.Component {
  render() {
    return (
      <>
      <Navbar bg="white" expand="lg" p = "3">
        <Container fluid>
          <Navbar.Brand href="#">
            <img src={img2}alt="" width="30" height="24" className="d-inline-block align-text-top"  id="logo"/>
            Bootstrap
          </Navbar.Brand>
        </Container>
      </Navbar>
      </>
    );
  }
}

export default MyNavbar;
